import React, { useEffect, useState } from 'react';
import "./BookAppointment.css";
import { useParams } from 'react-router-dom';

export default function BookAppointment() {

  const { userId } = useParams();

  const doctors = [];

  const [ selctedDoctor, setSelectedDocctor ] = useState();

  useEffect(() => {
    const fetchAllDoctors = async () => {
      try {
        const responce = await fetch('http://localhost:5000/doctor/all', {
          method : "GET",
          headers: {
            'Content-Type': 'application/json'
          },
        });

        const responce_data = await responce.json();
        doctors.push(responce_data.map((key) => {return key['name']}));
      }
      catch (error) {
        console.log(error);
      }
    }

    fetchAllDoctors();
  })

  return (
    <div id='bookappointment'>
        <select value={selctedDoctor}>

        </select>
    </div>
  )
}
